import React, { useState } from "react";
// Import Swiper React components
import { Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
import "swiper/css";
import "swiper/css/pagination"
import "swiper/css/navigation"


// import Swiper core and required modules
import SwiperCore, {
  Autoplay, Pagination, Navigation
} from 'swiper';

// install Swiper modules
SwiperCore.use([Autoplay, Pagination, Navigation]);



const Landing = () => {
  const [image, setImage] = useState([
    { id: 'slide-1', url: '/photoSlider/1.jpg' },
    { id: 'slide-2', url: '/photoSlider/2.jpg' },
    { id: 'slide-3', url: '/photoSlider/3.jpg' },
    { id: 'slide-4', url: '/photoSlider/4.jpg' }
  ])
  const [imgBaner, setImgBaner] = useState([
    { id: 'banner-1', url: '/photoSlider/1.jpg' },
    { id: 'banner-2', url: '/photoSlider/2.jpg' }
  ])
  return (
    <div className="container mx-auto p-2 sm:p-0 flex flex-col lg:flex-row">
      <Swiper className='lg:w-3/4' spaceBetween={30} centeredSlides={true} autoplay={{
        "delay": 2500,
        "disableOnInteraction": false
      }} pagination={{
        "clickable": true
      }} navigation={true} className="mySwiper">
        {image.map(slide => {
          return <SwiperSlide className='rounded' key={slide.id}><img src={slide.url} alt='notLoaded'></img></SwiperSlide>
        })}
      </Swiper>
      <div className='w-full flex lg:w-1/4 lg:flex-col'>
        {imgBaner.map(banner => {
          return <img className='w-1/2 lg:w-full rounded-md' src={banner.url} alt='notLoaded'></img>
        })}
      </div>
    </div>
  );
}

export default Landing;
